import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using ID selector
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Type 'iPhone' into the search input
    await page.fill('#searchInput', 'iPhone');

    // Take screenshot after typing
    const step2 = path.join(screenshotsDir, 'step_2_typed_iphone.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the search button using a different selector (first .search-btn after input)
    // Use xpath to find the button following the input
    const [searchBtn] = await page.$x("//input[@id='searchInput']/following-sibling::button[contains(@class,'search-btn')]");
    if (searchBtn) {
      await searchBtn.click();
    } else {
      // Fallback: click the first visible .search-btn
      const btn = await page.waitForSelector('.search-btn', { timeout: 5000 });
      await btn.click();
    }

    // Wait for the search results header (h2 with text 'Search Results')
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Take screenshot of the results
    const step3 = path.join(screenshotsDir, 'step_3_search_results.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the number of results and product titles
    let extractedData = {};
    try {
      // Results count
      const resultsCount = await page.textContent('.results-count');
      // Product titles (up to 5)
      const titles = await page.$$eval('.product-title', nodes => nodes.slice(0,5).map(n => n.textContent.trim()));
      extractedData = {
        resultsCount,
        productTitles: titles
      };
    } catch (err) {
      extractedData = { error: "Could not extract results or titles" };
    }

    return {
      success: true,
      action: "Searched for 'iPhone' and captured search results",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
